import grey from "@material-ui/core/colors/grey";

const boxBgColor = grey[100];

const styles = theme => ({
    statisticCard: {
         marginTop: theme.spacing(3),
         padding: theme.spacing(2),
         width: "50vw",
    },
    chart: {
       marginTop: theme.spacing(1),
    },
    answerBox: {
       backgroundColor: boxBgColor,
       width: "40vw",
       marginTop: theme.spacing(1),
       padding: "10",
    }
 })

 export default styles;
